import styled from 'styled-components'
export const StyleChangePassword = styled.div`


    padding:20px;

     label {
        color: var(--black);
        text-align: initial;

     }
     hr {
       background: var(--black);
     }
     .row {
       width:100%;
       padding-top:20px;

     }

     .aling-button {
       padding:  20px 0px 5px 0px;
     }

     .form-group {
       width:100%;
     }

     .btn {
      background-color: var(--primary);
      height: 34px;
      padding: 0px!important;
      font-size: 15px;
      width: 150px;
    }

    .row-aling {
       display: flex;
       flex-wrap: inherit;
    }


    .row-aling {
      justify-content:  space-between;
    }


     h1 {
        display: flex;
        justify-content: center;
        color: black;
        padding:10px;
        text-align: center;

     }

     .painel {
        width: 58%;
     }

    @media(max-width:765px) {
      label {
        text-align: initial;
      }

      .painel {
       width: 100%;
       justify-content: center;
       display: contant;
      }

      .row-aling {
      justify-content:center
      }
      .input-aling {
         width: 88%;

      }
      .row {
            display: contents;
      }

      .btn {
        padding: 7px;

      }

      .aling-button {
        display: flex;
       justify-content: center;
      }


    }


    }



`
